-- +--------+
-- | Inicio | ¡¡Siempre hay que crear una clase de inicio llamada "Main" 
-- +--------+   como punto de entrada!!

Main = class()

--Inicialización de la clase.
function Main:init()
    -- Creamos los widgets.
    tableBox = TableBox(4, 2, 310, 165, {65, 244}, nil, {"CENTER", "CENTER"}, false)
    escapeKeyBox1 = EscapeKeyBox("Not show", false)
    
    -- Añadimos los widgets a la caja maestra.
    MASTERBOX = MasterBox(APP_NAME .. ". Versión " .. APP_VERSION)
    MASTERBOX:addWidget(tableBox)
    MASTERBOX:addNewLine()
    MASTERBOX:addWidget(escapeKeyBox1)
    
    -- Añadimos los datos a la tabla.
    tableBox.data = {"Test", "Test with all widgets of the toolkit 1",
                     "Test", "Test with all widgets of the toolkit 2",
                     "Test", "Test with all widgets of the toolkit 3",
                     "Copyright", "Acerca de " .. APP_NAME}
    
    -- Añadimos los eventos.
    MASTERBOX:addEvent(tableBox, "ENTER", Main.Launch)
    
    -- Mostramos la pantalla de inicio.
    MASTERBOX:showSplash()
end

function Main:Launch()
    if tableBox.activeCell[1] == 1 then
        helpLaunch(Test01)
    elseif tableBox.activeCell[1] == 2 then
        helpLaunch(Test02)
    elseif tableBox.activeCell[1] == 3 then
        helpLaunch(Test03)
    elseif tableBox.activeCell[1] == 4 then
        helpLaunch(About)
    end
end

