-- Geometría de la pantalla.
X = 0
Y = 0
WIDTH = 318                            -- Ancho de la pantalla.
HEIGHT = 212                           -- Alto de la pantalla.

-- Geometría de la separación (EDGE).
EDGE = 4                               -- Separación de todo el cuadro de diálogo.
EDGE_HORIZONTAL = 4                    -- Separación horizontal entre los componetes.  
EDGE_VERTICAL = 4                      -- Separación vertical entre los componetes.
EDGE_BUBBLE = 6                        -- Separación vertical entre los componetes.

-- Geometría del espacio dentro del componente (PADDING)
PADDING_HORIZONTAL = 4                 -- Espacio horizontal dentro del componente.
PADDING_VERTICAL = 3                   -- Espacio vertical dentro del componente.

-- Geometría del borde interno entre dos áreas del componente.
BORDER = 1                             -- Ancho horizontal y vertical que mide el borde. 

-- Tamaño de los iconos.
ICON_SIZE = 24                         -- Tamaño horizontal y vertical de los iconos.

-- Tamaño de la flecha.
ARROW_SIZE = 8                         -- Tamaño de la cabeza de la flecha.

-- Tamaño del botón de la esquina.
CORNER_SIZE = 24                       -- Tamaño del botón de la esquina.

-- Variables del texto.
FONT_SIZE = 9                          -- Tamaño de la fuente de texto.
FONT_HEIGHT = 13                       -- Altura del texto.

-- Colores del sistema.
COLOR_LIGHTEND = {255, 255, 255}       -- Color más claro.
COLOR_LIGHT =    {236, 236, 236}       -- Color más claro.
COLOR_MIDLIGHT = {230, 230, 230}       -- Color normal.
COLOR_MID =      {204, 204, 204}       -- Color normal.
COLOR_MIDDARK =  {179, 179, 179}       -- Color normal.
COLOR_DARK =     {128, 128, 128}       -- Color más oscuro.
COLOR_DARKEND =  {102, 102, 102}       -- Color más oscuro.

COLOR_TEXT =       {  0,   0,   0}     -- Color del texto.
COLOR_FOCUS =      {110, 160, 205}     -- Color del foco.
COLOR_SELECTHIGH = {160, 210, 255}     -- Color de selección.
COLOR_SELECTLOW =  {220, 230, 255}     -- Color de selección.
COLOR_SYMBOL =     { 90, 140, 185}     -- Color de los símbolos.
COLOR_ERRORLINE =  {200, 100, 100}     -- Color de error de líneas.
COLOR_ERRORBACK =  {255, 200, 200}     -- Color de error de fondo.

COLOR_APP =        {212, 0,   0}     -- Color de la aplicación.

-- Variables de la API.
MASTERBOX = nil                        -- Caja maestra de la iterfaz.
TEMP_HEIGHT = 0                        -- Valor de altura de widget a aplicacar en el salto de linea
SPLASH = true                         -- Evitar que el splash aparezca continuamente.

-- ****************************************************************************
-- * CICLO BÁSICO:
-- ****************************************************************************

function on.construction()
    main = Main()
end

-- Evento insertar valores
function on.charIn(char)
    if MASTERBOX:onCharIn(char) == true then
        platform.window:invalidate()
    end
end

-- Evento presionar la tecla de intro.
function on.enterKey()
    if MASTERBOX:onEnterKey() == true then
        platform.window:invalidate()
    end
end

-- Evento presionar la tecla de escape.
function on.escapeKey()
    if MASTERBOX:onEscapeKey() == true then
        platform.window:invalidate()
    end
end

-- Evento presionar la tecla de retroceso.
function on.backspaceKey()
    if MASTERBOX:onBackspaceKey() == true then
        platform.window:invalidate()
    end
end

-- Eventos presionar las teclas del cursor.
function on.arrowUp()
	if MASTERBOX:onArrows("UP") == true then
	    platform.window:invalidate()
	end
end
function on.arrowDown()
    if MASTERBOX:onArrows("DOWN") == true then
	    platform.window:invalidate()
	end
end
function on.arrowLeft()
    if MASTERBOX:onArrows("LEFT") == true then
	    platform.window:invalidate()
	end
end
function on.arrowRight()
	if MASTERBOX:onArrows("RIGHT") == true then
	    platform.window:invalidate()
	end
end

-- Evento presionar la tecla de tabulador.
function on.tabKey()
    --Buscamos un nuevo widget con foco.
    MASTERBOX:nextFocus()
    platform.window:invalidate()
end

-- Evento tiempo.
function on.timer()
    platform.window:invalidate()
    timer.stop()
end

-- Evento de dibujado.
function on.paint(gc)
    --Dibujamos la caja maestra.
    MASTERBOX:drawWidget(gc)
end

-- ****************************************************************************
-- * WIDGETS
-- ****************************************************************************

WidgetBox = class()
function WidgetBox:drawWidget() end

-- +----------+
-- | LabelBox |
-- +----------+

LabelBox = class(WidgetBox)

function LabelBox:init(text)
    --Tipo de Widget
    self.typeBox = "LabelBox"

    -- Mecanismos para el foco.
    self.hasFocus = false
    self.focus = false

    -- Mecanismos para las flechas.
    self.hasArrows = false 

    -- Mecanismos para errores.
    self.hasError = false

    -- Variables del componente.
    self.text = text
end

function LabelBox:launchEvent(signal, slot, func) end

function LabelBox:drawWidget(gc)
    local widthText = gc:getStringWidth(self.text)
    
    gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
    gc:drawString(self.text, X, Y + FONT_HEIGHT + PADDING_VERTICAL)
    
    --Geometría final.
	X = X + widthText + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, FONT_HEIGHT + 2 * PADDING_VERTICAL)
end

-- +----------+
-- | ArrowBox |
-- +----------+

ArrowBox = class(WidgetBox)

function ArrowBox:init(width, leftArrow, rightArrow)
    --Tipo de Widget
    self.typeBox = "ArrowBox"

    -- Mecanismos para el foco.
    self.hasFocus = false
    self.focus = false

    -- Mecanismos para las flechas.
    self.hasArrows = false 
    
    -- Mecanismos para errores.
    self.hasError = false

    -- Variables del componente.
    self.width = width
    self.leftArrow = leftArrow
    self.rightArrow = rightArrow
end

function ArrowBox:launchEvent(signal, slot, func) end

function ArrowBox:drawWidget(gc)
    local centerY = Y + FONT_HEIGHT / 2 + PADDING_VERTICAL
    local halfArrow = ARROW_SIZE / 2

    --Dibujamos la linea de la fecha.
    gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
    gc:drawLine(X, centerY,
                X + self.width, centerY)

    --Dibujamos las flechas.
    if self.leftArrow == true then
        gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
        gc:drawPolyLine({X + ARROW_SIZE, centerY - halfArrow,
                         X, centerY,
                         X + ARROW_SIZE, centerY + halfArrow})
    end
    
    if self.rightArrow == true then
        gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
        gc:drawPolyLine({X + self.width - ARROW_SIZE, centerY - halfArrow,
                         X + self.width, centerY,
                         X + self.width - ARROW_SIZE, centerY + halfArrow})
    end
    
    --Geometría final.
	X = X + self.width + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, FONT_HEIGHT + 2 * PADDING_VERTICAL)
end

-- +---------+
-- | LineBox |
-- +---------+

LineBox = class(WidgetBox)

function LineBox:init(width)
    --Tipo de Widget
    self.typeBox = "LineBox"

    -- Mecanismos para el foco.
    self.hasFocus = false
    self.focus = false

    -- Mecanismos para las flechas.
    self.hasArrows = false
    
    -- Mecanismos para errores.
    self.hasError = false

    -- Variables del componente.
    self.width = width
end

function LineBox:launchEvent(signal, slot, func) end

function LineBox:drawWidget(gc) 
    --Dibujamos la linea.
    gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
    gc:drawLine(X, Y, X + self.width, Y)
    gc:setColorRGB(COLOR_LIGHTEND[1], COLOR_LIGHTEND[2], COLOR_LIGHTEND[3])
    gc:drawLine(X, Y + 1, X + self.width, Y + 1)
    
    --Geometría final.
	X = X + self.width + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, 1)
end

-- +--------+
-- | ParBox |
-- +--------+

ParBox = class(WidgetBox)

function ParBox:init(text, width, debug)
    --Tipo de Widget
    self.typeBox = "ParBox"

    -- Mecanismos para el foco.
    self.hasFocus = false
    self.focus = false

    -- Mecanismos para las flechas.
    self.hasArrows = false
    
    -- Mecanismos para errores.
    self.hasError = false

    -- Variables del componente.
    self.text = text
    self.width = width
    self.debug = debug
end

function ParBox:launchEvent(signal, slot, func) end

function ParBox:drawWidget(gc)
    gc:setFont("sansserif", "r", FONT_SIZE - 1)
    local lineHeight = gc:getStringHeight(self.text)
    
    -- Dividimos el texto en una matriz de palabras sueltas.
    gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
    local y = Y
    local words = string.split(self.text, " ")
    local lineWidth = 0
    local lineText = ""
    for k = 1, #words do
        lineWidth = lineWidth + gc:getStringWidth(words[k] .. " ")
        if lineWidth < self.width then
            lineText = lineText .. words[k] .. " "
        else
            gc:drawString(lineText, X, y + lineHeight)
            y = y + lineHeight
            lineWidth = gc:getStringWidth(words[k] .. " ")
            lineText = words[k] .. " "
        end
    end
    gc:drawString(lineText, X, y + lineHeight)
    y = y + lineHeight
    
    gc:setFont("sansserif", "r", FONT_SIZE)
    
    -- Dibujamos el fondo debug para testeos.
    if self.debug == true then
        gc:setColorRGB(255, 0, 0)
        gc:drawRect(X, Y, self.width - 1, y - Y - 1)
    end
    
    -- Geometría final.
	X = X + self.width + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, y - Y)
end

-- +-----------+
-- | NumberBox |
-- +-----------+

NumberBox = class(WidgetBox)

function NumberBox:init(width, align)
    --Tipo de Widget
    self.typeBox = "NumberBox"

    -- Mecanismos para el foco.
    self.hasFocus = true
    self.focus = false
    
    -- Mecanismos para las flechas.
    self.hasArrows = false
    
    -- Mecanismos para errores.
    self.hasError = false
    
    -- Variables del componente.
    self.width = width
    self.align = align
    
    -- Variables internas.
    self.text = "0"
end

function NumberBox:launchEvent(signal, slot, func)
    if signal == slot then
        if slot == "TEXT_CHANGE" then
            func()
        elseif slot == "ENTER" then 
            func()
        end
    end
end

function NumberBox:drawWidget(gc)
    -- Dibujamos el foco.
    if self.focus == true then
        gc:setColorRGB(COLOR_FOCUS[1], COLOR_FOCUS[2], COLOR_FOCUS[3])
        gc:drawRect(X - 2, Y - 2, self.width + 3, FONT_HEIGHT + 2 * PADDING_VERTICAL + 3)
    end

    -- Dibujamos el fondo
    if self.hasFocus == true then
        if self.hasError == true then
            gc:setColorRGB(COLOR_ERRORBACK[1], COLOR_ERRORBACK[2], COLOR_ERRORBACK[3])
            gc:fillRect(X, Y, self.width, FONT_HEIGHT + 2 * PADDING_VERTICAL)
        else
            gc:setColorRGB(COLOR_LIGHTEND[1], COLOR_LIGHTEND[2], COLOR_LIGHTEND[3])
            gc:fillRect(X, Y, self.width, FONT_HEIGHT + 2 * PADDING_VERTICAL)
        end
    end

    -- Dibujamos el texto
    gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
    helpTextBox(gc, X + PADDING_HORIZONTAL, Y, self.width - 2 * PADDING_HORIZONTAL, FONT_HEIGHT + 2 * PADDING_VERTICAL, self.text, self.align)

    -- Dibujamos las lineas.
    gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
    gc:drawPolyLine({X, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 1,
                     X, Y,
                     X + self.width - 1, Y})
    gc:setColorRGB(COLOR_LIGHT[1], COLOR_LIGHT[2], COLOR_LIGHT[3])
    gc:drawPolyLine({X + 1, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 1,
                     X + self.width - 1, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 1,
                     X + self.width - 1, Y + 1})

    gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
    gc:drawPolyLine({X + 1, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                     X + 1, Y + 1,
                     X + self.width - 2, Y + 1})
    gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
    gc:drawPolyLine({X + 2, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                     X + self.width - 2, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                     X + self.width - 2, Y + 2})

    -- Dibujamos el indicador de error.
    if self.hasError == true then
        gc:setColorRGB(COLOR_ERRORLINE[1], COLOR_ERRORLINE[2], COLOR_ERRORLINE[3])
        gc:drawRect(X + 1, Y + 1, self.width - 3, FONT_HEIGHT + 2 * PADDING_VERTICAL - 3)
        gc:drawRect(X + 2, Y + 2, self.width - 5, FONT_HEIGHT + 2 * PADDING_VERTICAL - 5)
    end
 
    --Geometría final.
	X = X + self.width + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, FONT_HEIGHT + 2 * PADDING_VERTICAL)
end

-- +----------------+
-- | LetterComboBox |
-- +----------------+

LetterComboBox = class(WidgetBox)

function LetterComboBox:init(width, valuesCount, values, handleLetter)
    --Tipo de Widget
    self.typeBox = "LetterComboBox"

    -- Mecanismos para el foco.
    self.hasFocus = false
    self.focus = false
    
    -- Mecanismos para las flechas.
    self.hasArrows = false
    
    -- Mecanismos para errores.
    self.hasError = false
    
    -- Variables del componente.
    self.width = width
    self.valuesCount = valuesCount
    self.values = values
    self.handleLetter = handleLetter
    
    --Variable internas
    self.active = 1
end

function LetterComboBox:getActive()
    return self.values[self.active]
end

function LetterComboBox:nextActive()
    self.active = self.active + 1 
    
    -- Corregimos si estamos fuera de rango
    if self.active > self.valuesCount then
        self.active = 1
    end
end

function LetterComboBox:launchEvent(signal, slot, func)
    if signal == slot then
        if slot == "KEY_PRESS" then
            func()
        end
    end
end

function LetterComboBox:drawWidget(gc)
    local widthLetter = gc:getStringWidth(self.handleLetter)

    -- Dibujamos el foco.
    if self.focus == true then
        gc:setColorRGB(COLOR_FOCUS[1], COLOR_FOCUS[2], COLOR_FOCUS[3])
        gc:drawRect(X - 2, Y - 2, self.width + 3, FONT_HEIGHT + 2 * PADDING_VERTICAL + 3)
    end

    --Dibujamos el fondo
    gc:setColorRGB(COLOR_LIGHT[1], COLOR_LIGHT[2], COLOR_LIGHT[3])
    gc:fillRect(X, Y, widthLetter + 2 * PADDING_HORIZONTAL, FONT_HEIGHT + 2 * PADDING_VERTICAL)

    -- Dibujamos las lineas.
    gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
    gc:drawRect(X, Y, self.width - 1, FONT_HEIGHT + 2 * PADDING_VERTICAL - 1)
    gc:setColorRGB(COLOR_LIGHTEND[1], COLOR_LIGHTEND[2], COLOR_LIGHTEND[3])
    gc:drawPolyLine({X + 1, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                     X + 1, Y + 1,
                     X + self.width - 2, Y + 1})
    gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
    gc:drawPolyLine({X + 2, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                     X + self.width - 2, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                     X + self.width - 2, Y + 2})   
    gc:drawLine(X + widthLetter + 2 * PADDING_HORIZONTAL + 1, Y + 2,
                X + widthLetter + 2 * PADDING_HORIZONTAL + 1, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2)

    -- Dibujamos el texto.
    gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
    gc:drawString(self.handleLetter, X + PADDING_HORIZONTAL, Y + FONT_HEIGHT + PADDING_VERTICAL)
    helpTextBox(gc, X + widthLetter + 3 * PADDING_HORIZONTAL, Y, self.width - widthLetter - BORDER - 4 * PADDING_HORIZONTAL, FONT_HEIGHT + 2 * PADDING_VERTICAL, self.values[self.active], "LEFT")
    
    --Geometría final.
	X = X + self.width + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, FONT_HEIGHT + 2 * PADDING_VERTICAL)
end

-- +-----------+
-- | ButtonBox |
-- +-----------+

ButtonBox = class(WidgetBox)

function ButtonBox:init(width, text)
    --Tipo de Widget
    self.typeBox = "ButtonBox"

    -- Mecanismos para el foco.
    self.hasFocus = true
    self.focus = false
    
    -- Mecanismos para las flechas.
    self.hasArrows = false
    
    -- Mecanismos para errores.
    self.hasError = false
    
    -- Variables del componente.
    self.width = width
    self.text = text
    
    --Variable internas
    self.pressed = false
end

function ButtonBox:launchEvent(signal, slot, func)
    if signal == slot then
        if slot == "ENTER" then
            func()
        end
    end
end

function ButtonBox:drawWidget(gc)
    -- Dibujamos el foco.
    if self.focus == true then
        gc:setColorRGB(COLOR_FOCUS[1], COLOR_FOCUS[2], COLOR_FOCUS[3])
        gc:drawRect(X - 2, Y - 2, self.width + 3, FONT_HEIGHT + 2 * PADDING_VERTICAL + 3)
    end

    --Dibujamos el fondo y aprovechamos para asignar el desplazamiento.
    local dy = 0
    if self.pressed == false then
        -- Dibujamos el fondo.
        gc:setColorRGB(COLOR_LIGHT[1], COLOR_LIGHT[2], COLOR_LIGHT[3])
        gc:fillRect(X, Y, self.width, FONT_HEIGHT + 2 * PADDING_VERTICAL)
        
        -- Dibujmaos las líneas.
        gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
        gc:drawRect(X, Y, self.width - 1, FONT_HEIGHT + 2 * PADDING_VERTICAL - 1)
        gc:setColorRGB(COLOR_LIGHTEND[1], COLOR_LIGHTEND[2], COLOR_LIGHTEND[3])
        gc:drawPolyLine({X + 1, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                         X + 1, Y + 1,
                         X + self.width - 2, Y + 1})
        gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
        gc:drawPolyLine({X + 2, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                         X + self.width - 2, Y + FONT_HEIGHT + 2 * PADDING_VERTICAL - 2,
                         X + self.width - 2, Y + 2})
        dy = 0
    else
        -- Dibujamos el fondo.
        gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
        gc:fillRect(X, Y, self.width, FONT_HEIGHT + 2 * PADDING_VERTICAL)
        
        -- Dibujmaos las líneas.
        gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
        gc:drawRect(X, Y, self.width - 1, FONT_HEIGHT + 2 * PADDING_VERTICAL - 1)
        dy = 1
    end

    -- Dibujamos el texto.
    gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
    helpTextBox(gc, X + PADDING_HORIZONTAL, Y + dy, self.width - 2 * PADDING_HORIZONTAL, FONT_HEIGHT + 2 * PADDING_VERTICAL, self.text, "CENTER")
    
    --Geometría final.
	X = X + self.width + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, FONT_HEIGHT + 2 * PADDING_VERTICAL)
	
	-- Devolvemos el estado no presionado.
	self.pressed = false
end

