function CheckBox:drawWidget(gc)
    local widthText = gc:getStringWidth(self.text)

    -- Dibujamos el foco.
    if self.focus == true then
        gc:setColorRGB(COLOR_FOCUS[1], COLOR_FOCUS[2], COLOR_FOCUS[3])
        gc:drawRect(X - 2, Y + PADDING_VERTICAL - 2, FONT_HEIGHT + EDGE_HORIZONTAL + widthText + 3, FONT_HEIGHT + 3)
    end

    -- Dibujamos el fondo
    gc:setColorRGB(COLOR_LIGHTEND[1], COLOR_LIGHTEND[2], COLOR_LIGHTEND[3])
    gc:fillRect(X, Y + PADDING_VERTICAL, FONT_HEIGHT, FONT_HEIGHT)

    -- Dibujamos las lineas.
    gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
    gc:drawPolyLine({X, Y + FONT_HEIGHT + PADDING_VERTICAL - 1,
                     X, Y + PADDING_VERTICAL,
                     X + FONT_HEIGHT - 1, Y + PADDING_VERTICAL})
    gc:setColorRGB(COLOR_LIGHT[1], COLOR_LIGHT[2], COLOR_LIGHT[3])
