                     X + FONT_HEIGHT - 1, Y + FONT_HEIGHT + PADDING_VERTICAL - 1,
                     X + FONT_HEIGHT - 1, Y + PADDING_VERTICAL + 1})
    gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
    gc:drawPolyLine({X + 1, Y + FONT_HEIGHT + PADDING_VERTICAL - 2,
                     X + 1, Y + PADDING_VERTICAL + 1,
                     X + FONT_HEIGHT - 2, Y + PADDING_VERTICAL + 1})
    gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
