                     X + FONT_HEIGHT - 2, Y + PADDING_VERTICAL + 2})
    
    -- Dibujamos el símbolo de check.
    if self.checked == true then
        gc:setColorRGB(COLOR_SYMBOL[1], COLOR_SYMBOL[2], COLOR_SYMBOL[3])
        gc:setPen("medium","smooth")
