	X = X + FONT_HEIGHT + EDGE_HORIZONTAL + widthText + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, FONT_HEIGHT + 2 * PADDING_VERTICAL)
end

-- +----------+
-- | TableBox |
-- +----------+

TableBox = class(WidgetBox)

function TableBox:init(rows, columns, width, height, headerWidth, headerText, headerAlign, borderless)
    --Tipo de Widget
    self.typeBox = "TableBox"

    -- Mecanismos para el foco.
    self.hasFocus = true
    self.focus = false
    
    -- Mecanismos para las flechas.
    self.hasArrows = true
    
    -- Mecanismos para errores.
    self.hasError = false
    
    -- Variables del componente.
    self.rows = rows
    self.columns = columns
    self.width = width
    self.height = height
    
    -- Datos de la cabecera.
    self.headerWidth = headerWidth
    self.headerText = headerText
    self.headerAlign = headerAlign

    -- Si dibujamos el foco por motivos de estética.
    self.borderless = borderless

    -- Dimensiones de la celda
    self.headerHeight = FONT_HEIGHT + 2 * PADDING_VERTICAL + BORDER
    if self.headerText == nil then
        self.headerHeight = 0
    end
    self.rowHeight = FONT_HEIGHT + 2 * PADDING_VERTICAL

    -- Calculamos el ancho y alto interno de la tabla.
    self.tableWidth = 0
    for k = 1, columns do
        self.tableWidth = self.tableWidth + self.headerWidth[k] + BORDER
    end
    self.tableHeight = rows * (self.rowHeight + BORDER)
    
    -- Calculamos el ancho y alto real de la zona de la tabla.
    self.realWidth = width
    self.realHeight = height - self.headerHeight
     
    --Variable internas
    self.overX = 0
    self.overY = 0
    self.activeCell = {1,1}
    self.data = nil
end

function TableBox:nextActive(arrow)
    -- Modificamos la celda activa.
    if arrow == "LEFT" then
        self.activeCell[2] = self.activeCell[2] - 1
        if self.activeCell[2] < 1 then self.activeCell[2] = 1 end
    elseif arrow == "RIGHT" then
        self.activeCell[2] = self.activeCell[2] + 1
        if self.activeCell[2] > self.columns then self.activeCell[2] = self.columns end
    elseif arrow == "UP" then
        self.activeCell[1] = self.activeCell[1] - 1
        if self.activeCell[1] < 1 then self.activeCell[1] = 1 end
    elseif arrow == "DOWN" then
        self.activeCell[1] = self.activeCell[1] + 1
        if self.activeCell[1] > self.rows then self.activeCell[1] = self.rows end
    end
    
    -- Modificamos el solape horizontalmente.
    if arrow == "LEFT" or arrow == "RIGHT" then
        local xa1 = X
        local xa2 = X + self.width
        local xb1 = 0
        local xb2 = 0
        
        -- Posción de la celda. 
        for j = 1, self.activeCell[2] - 1 do
            xb1 = xb1 + self.headerWidth[j] + BORDER
        end
        xb1 = xa1 + xb1 - self.overX
        xb2 = xb1 + self.headerWidth[self.activeCell[2]] + BORDER
        
        -- Modificamos el solape.
        if xb2 > xa2 then
            -- Modificamos el solape si vamos a la derecha
            self.overX = self.overX + (xb2 - xa2) 
        elseif xb1 < xa1 then
            -- Modificamos el solape si vamos a la izquierda.
            self.overX = self.overX + (xb1 - xa1) 
        end
    end
    
    -- Modificamos el solape verticalmente.
    if arrow == "UP" or arrow == "DOWN" then
        local ya1 = Y + self.headerHeight
        local ya2 = Y + self.height
        local yb1 = 0
        local yb2 = 0
        
        -- Posción de la celda. 
        for i = 1, self.activeCell[1] - 1 do
            yb1 = yb1 + self.rowHeight + BORDER
        end
        yb1 = ya1 + yb1 - self.overY
        yb2 = yb1 + self.rowHeight + BORDER
        
        -- Modificamos el solape.
        if yb2 > ya2 then
            -- Modificamos el solape si vamos a la derecha
            self.overY = self.overY + (yb2 - ya2) 
        elseif yb1 < ya1 then
            -- Modificamos el solape si vamos a la izquierda.
            self.overY = self.overY + (yb1 - ya1) 
        end
    end
end

function TableBox:launchEvent(signal, slot, func)
    if signal == slot then
        if slot == "ENTER" then
            func()
        elseif slot == "ARROWKEYS" then
            func()
        end
    end
end

function TableBox:drawWidget(gc)
    -- Dibujamos el foco.
    if self.focus == true and self.borderless ~= false then
        gc:setColorRGB(COLOR_FOCUS[1], COLOR_FOCUS[2], COLOR_FOCUS[3])
        gc:drawRect(X - 2, Y - 2, self.width + 3, self.height + 3)
    end

    -- Dibujamos el fondo
    gc:setColorRGB(COLOR_DARK[1], COLOR_DARK[2], COLOR_DARK[3])
    gc:fillRect(X, Y, self.width, self.height)

    -- Creamos un CLIP para la tabla.
    gc:clipRect("set", X, Y, self.realWidth, self.rowHeight + BORDER)
    
    -- Dibujamos la cabecera.
    local xTemp = X - self.overX
    local yTemp = Y
    if self.headerText ~= nill then        
        for j = 1, self.columns do
            -- Dibujamos el fondo de la cabecera.
            gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
            gc:fillRect(xTemp, yTemp, self.headerWidth[j], self.rowHeight)
            gc:setColorRGB(COLOR_DARKEND[1], COLOR_DARKEND[2], COLOR_DARKEND[3])
            gc:drawPolyLine({xTemp, yTemp + self.rowHeight,
                             xTemp + self.headerWidth[j], yTemp + self.rowHeight,
                             xTemp + self.headerWidth[j], yTemp})
            
            -- Dibujamos el texto de la cabecera.
            gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
            gc:setFont("sansserif", "r", FONT_SIZE - 1)
            local widthText = gc:getStringWidth(self.headerText[j])
            gc:drawString(self.headerText[j], xTemp + self.headerWidth[j] / 2 - widthText / 2, yTemp + FONT_HEIGHT + PADDING_VERTICAL)
            gc:setFont("sansserif", "r", FONT_SIZE)
            
            xTemp = xTemp + self.headerWidth[j] + BORDER
        end
    end
    
    -- Creamos un CLIP para la tabla.
    gc:clipRect("set", X, Y + self.headerHeight, self.realWidth, self.realHeight)
    
    -- Dibujamos los elementos de la tabla.
    xTemp = X - self.overX
    yTemp = Y + self.headerHeight - self.overY
    for i = 1, self.rows do
        for j = 1, self.columns do
            -- Dibujamos el fondo de la celda.
            if i == self.activeCell[1] and j == self.activeCell[2] then
                gc:setColorRGB(COLOR_SELECTHIGH[1], COLOR_SELECTHIGH[2], COLOR_SELECTHIGH[3])
            elseif i == self.activeCell[1] then
                gc:setColorRGB(COLOR_SELECTLOW[1], COLOR_SELECTLOW[2], COLOR_SELECTLOW[3])
            else
                gc:setColorRGB(COLOR_LIGHTEND[1], COLOR_LIGHTEND[2], COLOR_LIGHTEND[3])
            end
            gc:fillRect(xTemp, yTemp, self.headerWidth[j], self.rowHeight)
            gc:setColorRGB(COLOR_DARKEND[1], COLOR_DARKEND[2], COLOR_DARKEND[3])
            gc:drawPolyLine({xTemp, yTemp + self.rowHeight,
                             xTemp + self.headerWidth[j], yTemp + self.rowHeight,
                             xTemp + self.headerWidth[j], yTemp})
            
            -- Dibujamos el texto de la celda si tiene.
            local n = (i-1) * self.columns + j
            if self.data ~= nil then
                gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
                                         
                if self.headerAlign[j] == "LEFT" then
                    gc:drawString(self.data[n], xTemp + PADDING_HORIZONTAL, yTemp + FONT_HEIGHT + PADDING_VERTICAL)
                elseif self.headerAlign[j] == "CENTER" then
                    local widthText = gc:getStringWidth(self.data[n])
                    gc:drawString(self.data[n], xTemp + self.headerWidth[j] / 2 - widthText / 2, yTemp + FONT_HEIGHT + PADDING_VERTICAL)
                elseif self.headerAlign[j] == "RIGHT" then
                    local widthText = gc:getStringWidth(self.data[n])
                    gc:drawString(self.data[n], xTemp + self.headerWidth[j] - PADDING_HORIZONTAL - widthText, yTemp + FONT_HEIGHT + PADDING_VERTICAL)
                end
            end
            
            xTemp = xTemp + self.headerWidth[j] + BORDER
        end
        xTemp = X - self.overX
        yTemp = yTemp + self.rowHeight + BORDER
    end
    
    -- Deshacemos el CLIP de la tabla.
    gc:clipRect("reset")

    -- Dibujamos las lineas.
    gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
    gc:drawPolyLine({X, Y + self.height - 1,
                     X, Y,
                     X + self.width - 1, Y})               
    gc:setColorRGB(COLOR_LIGHT[1], COLOR_LIGHT[2], COLOR_LIGHT[3])
    gc:drawPolyLine({X + 1, Y + self.height - 1,
                     X + self.width - 1, Y + self.height - 1,
                     X + self.width - 1, Y + 1})
    gc:setColorRGB(COLOR_DARKEND[1], COLOR_DARKEND[2], COLOR_DARKEND[3])
    gc:drawRect(X + 1, Y + 1, self.width - 3, self.height - 3)

    -- Geometría final.
	X = X + self.width + EDGE_HORIZONTAL
	TEMP_HEIGHT = math.max(TEMP_HEIGHT, self.height)
end

