-- ****************************************************************************
-- * CLASE MAESTRA DEL MANEJO DE WIDGETS:
-- ****************************************************************************

MasterBox = class()

function MasterBox:init(title)
    -- Valores del MasterBox.
    self.title = title

    -- Widgets alamacenados.
    self.widgetsCount = 0
    self.widgets = {}
    
    -- Mecanismos para el foco.
    self.widgetFocus = nil
    
    -- Mecanismos para los eventos de los widgets con foco.
    self.eventsFocusCount = 0
    self.eventsFocus = {}
    
    -- Mecanismos para los eventos de los widgets sin foco.
    self.eventsNoFocusCount = 0
    self.eventsNoFocus = {}
    
    -- Mecanismos para el Bubble.
    self.isShowBubble = false
    self.bubbleTitle = "Título"
    self.bubbleDescription = "Descripción"
    
    -- Mecanismos para la pantalla de inicio.
    self.isShowSplash = false
end

-- +--------------------------------+
-- | Mecanismos para añadir widgets |
-- +--------------------------------+

function MasterBox:addWidget(widget)
    self.widgetsCount = self.widgetsCount + 1
    self.widgets[self.widgetsCount] = widget
    
    --Asignamos el foco al primero que se añada que pueda poseerlo
    if widget.hasFocus == true and self.widgetFocus == nill then
        self.widgetFocus = self.widgetsCount
        self.widgets[self.widgetsCount].focus = true
    end
end

function MasterBox:addNewLine()
    self.widgetsCount = self.widgetsCount + 1
    self.widgets[self.widgetsCount] = NewLineBox()    
end

-- +--------------------------------+
-- | Mecanismos para añadir eventos |
-- +--------------------------------+

function MasterBox:addEvent(widget, slot, func)
    if widget.hasFocus == true then
        -- Si es un evento de un widget con foco lo añadimos a la lista de eventos con foco.
        self.eventsFocusCount = self.eventsFocusCount + 1
        self.eventsFocus[self.eventsFocusCount] = {widget, slot, func}
    else
        -- Si es un evento de un widget sin foco lo añadimos a la lista de eventos con foco.
        self.eventsNoFocusCount = self.eventsNoFocusCount + 1
        self.eventsNoFocus[self.eventsNoFocusCount] = {widget, slot, func}
    end
end

-- +--------------------------------------+
-- | Mecanismos para el manejo de eventos |
-- +--------------------------------------+

-- Acción pulsar la tecla enter.
function MasterBox:onEnterKey()
    -- Si está activado el bubble anulamos los eventos de todo tipo.
    if self.isShowBubble == false then
        local needInvalidate = false
    
        -- Widgets que necesitan foco.
        if self.widgets[self.widgetFocus].typeBox == "CheckBox" then
            if self.widgets[self.widgetFocus].checked == true then
                self.widgets[self.widgetFocus].checked = false
            else
                self.widgets[self.widgetFocus].checked = true
            end
            needInvalidate = true
        elseif self.widgets[self.widgetFocus].typeBox == "ButtonBox" then
            self.widgets[self.widgetFocus].pressed = true
            helpWait(1/3)
            needInvalidate = true
         elseif self.widgets[self.widgetFocus].typeBox == "CornerButtonBox" then
            self.widgets[self.widgetFocus].pressed = true
            helpWait(1/3)
            needInvalidate = true
        elseif self.widgets[self.widgetFocus].typeBox == "TableBox" then
            needInvalidate = true
        end
        
        -- Lanzamos eventos que tienen foco porque este evento necesita tener foco.
        for k = 1, self.eventsFocusCount do
            if self.widgets[self.widgetFocus] == self.eventsFocus[k][1] then
                print("Localizado evento CON FOCO --> Widget: \"" .. self.eventsFocus[k][1].typeBox .. "\" Signal: \"ENTER\" Slot: \"" .. self.eventsFocus[k][2] .. "\"")
                self.eventsFocus[k][1]:launchEvent("ENTER", self.eventsFocus[k][2], self.eventsFocus[k][3])
            end
        end
        
        return needInvalidate
    end
end

-- Acción pulsar la tecla escape.
function MasterBox:onEscapeKey()
    -- Si está activado el bubble anulamos los eventos de todo tipo.
    if self.isShowBubble == false then
       local needInvalidate = false
       
       -- Pantalla de splash de inicio.
       if self.isShowSplash == true then
           self.isShowSplash = false
           SPLASH = false
           needInvalidate = true
       end
       
       -- Widgets que no necesitan foco.
       for k = 1, self.widgetsCount do
           if self.widgets[k].typeBox == "EscapeKeyBox" then         
                -- Exploramos si hay algún evento no foco para este componente.
                for m = 1, self.eventsNoFocusCount do
                    if self.widgets[k] == self.eventsNoFocus[m][1] then
                        print("Localizado evento SIN FOCO --> Widget: \"" .. self.eventsNoFocus[m][1].typeBox .. "\" Signal: \"KEY_PRESS\" Slot: \"" .. self.eventsNoFocus[m][2] .. "\"")
                        self.eventsNoFocus[m][1]:launchEvent("KEY_PRESS", self.eventsNoFocus[m][2], self.eventsNoFocus[m][3])
                    end
                end
                
                needInvalidate = true
            end
        end
        
        return needInvalidate
    else
        self.isShowBubble = false
        return true
    end
end

function MasterBox:onBackspaceKey()
    -- Si está activado el bubble anulamos los eventos de todo tipo.
    if self.isShowBubble == false then
        local needInvalidate = false
    
        -- Widgets que necesitan foco.
        if self.widgets[self.widgetFocus].typeBox == "NumberBox" then
            -- Quitamos el último caracter.
            self.widgets[self.widgetFocus].text =  self.widgets[self.widgetFocus].text:usub(0,-2)
            
            -- Filtramos para que lo que pasemos sea un número, sino marcamos el error.
            local auxIn = tonumber(self.widgets[self.widgetFocus].text)
            if auxIn ~= nil then
                -- Desmarcamos el error.
                self.widgets[self.widgetFocus].hasError = false
            else
                -- Marcamos el error.
                self.widgets[self.widgetFocus].hasError = true
            end
            needInvalidate = true
        end
        
        -- Lanzamos eventos que tienen foco porque este evento necesita tener foco.
        for k = 1, self.eventsFocusCount do
            if self.widgets[self.widgetFocus] == self.eventsFocus[k][1] then
                print("Localizado evento CON FOCO --> Widget: \"" .. self.eventsFocus[k][1].typeBox .. "\" Signal: \"TEXT_CHANGE\" Slot: \"" .. self.eventsFocus[k][2] .. "\"")
                self.eventsFocus[k][1]:launchEvent("TEXT_CHANGE", self.eventsFocus[k][2], self.eventsFocus[k][3])
            end
        end
        
        return needInvalidate
    end
end

-- Acción insertar un caracter, letra o número.
function MasterBox:onCharIn(char)
    -- Si está activado el bubble anulamos los eventos de todo tipo.
    if self.isShowBubble == false then
        local needInvalidate = false
        local widgetNoFocus = false
    
        -- Widgets que no necesitan foco.
        for k = 1, self.widgetsCount do
            if self.widgets[k].typeBox == "LetterComboBox" then
                -- Si es la letra del combo aplicamos cambios.
                if self.widgets[k].handleLetter == string.upper(char) or self.widgets[k].handleLetter == string.lower(char) then
                    self.widgets[k]:nextActive()
                    needInvalidate = true
    
                    -- Exploramos si hay algún evento no foco para este componente.
                    for m = 1, self.eventsNoFocusCount do
                        if self.widgets[k] == self.eventsNoFocus[m][1] then
                            print("Localizado evento SIN FOCO --> Widget: \"" .. self.eventsNoFocus[m][1].typeBox .. "\" Signal: \"KEY_PRESS\" Slot: \"" .. self.eventsNoFocus[m][2] .. "\"")
                            self.eventsNoFocus[m][1]:launchEvent("KEY_PRESS", self.eventsNoFocus[m][2], self.eventsNoFocus[m][3])
                        end
                    end
                    
                    -- El widget es del tipo no foco.
                    widgetNoFocus = true
                end
            end
        end
    
        -- Widgets que necesitan foco.
        if widgetNoFocus == false then
            if self.widgets[self.widgetFocus].typeBox == "NumberBox" then
                -- Concatenamos el nuevo caracter.
                self.widgets[self.widgetFocus].text = self.widgets[self.widgetFocus].text .. char
                
                -- Filtramos para que lo que pasemos sea un número, sino marcamos el error.
                local auxIn = tonumber(self.widgets[self.widgetFocus].text)
                if auxIn ~= nil then
                    -- Desmarcamos el error.
                    self.widgets[self.widgetFocus].hasError = false
                else
                    -- Marcamos el error.
                    self.widgets[self.widgetFocus].hasError = true
                end
                
                needInvalidate = true
            end
        
            -- Eventos con foco
            for k = 1, self.eventsFocusCount do
                if self.widgets[self.widgetFocus] == self.eventsFocus[k][1] then
                    print("Localizado evento CON FOCO --> Widget: \"" .. self.eventsFocus[k][1].typeBox .. "\" Signal: \"TEXT_CHANGE\" Slot: \"" .. self.eventsFocus[k][2] .. "\"")
                    self.eventsFocus[k][1]:launchEvent("TEXT_CHANGE", self.eventsFocus[k][2], self.eventsFocus[k][3])
                end
            end
        end
    
        return needInvalidate
    end
end

-- Acción presionar una tecla de cursosr.
function MasterBox:onArrows(arrow)
    -- Si está activado el bubble anulamos los eventos de todo tipo.
    if self.isShowBubble == false then
        local needInvalidate = false
    
        -- Widgets que necesitan foco.
        if self.widgets[self.widgetFocus].hasArrows == true then
            self.widgets[self.widgetFocus]:nextActive(arrow)
            
            -- Eventos con foco
            for k = 1, self.eventsFocusCount do
                if self.widgets[self.widgetFocus] == self.eventsFocus[k][1] then
                    print("Localizado evento CON FOCO --> Widget: \"" .. self.eventsFocus[k][1].typeBox .. "\" Signal: \"ARROWKEYS\" Slot: \"" .. self.eventsFocus[k][2] .. "\"")
                    self.eventsFocus[k][1]:launchEvent("ARROWKEYS", self.eventsFocus[k][2], self.eventsFocus[k][3])
                end
            end
            
            needInvalidate = true
        end
        
        return needInvalidate
    end
end

-- +-----------------------------------+
-- | Mecanismo para el manejo del foco |
-- +-----------------------------------+

function MasterBox:nextFocus()
    --Si hay elementos con cambio de foco lo analizamos.
    if self.widgetFocus ~= nil and self.isShowBubble == false then
        --Desactivamos el foco del elemento acutal.
        self.widgets[self.widgetFocus].focus = false
        
        --Buscamos un nuevo elemento con foco.
        local changeFocus = true
        local k = self.widgetFocus
        while changeFocus == true do
            -- Aumentamos la cuenta del contador
            k = k + 1
            if k > self.widgetsCount then
                k = 1
            end
            
            -- Vemos si puede recibir un nuevo foco.
            if self.widgets[k].hasFocus == true then
                -- Nos guardamos quien tiene ahora el foco.
                self.widgetFocus = k
                
                -- Activamos el foco del elemento acutal.
                self.widgets[k].focus = true
                
                -- Änulamos el bucle.
                changeFocus = false
            end
        end
    end
end

