function MasterBox:drawBubble(gc, title, description)
    MasterBox:alphaScreen(gc)

    -- Valores de los textos.
    local textHelp = "(Press the escape key to exit)"
    
    -- Textos del bubble de manera individual.
    gc:setFont("sansserif", "b", FONT_SIZE)
    local widthTitle = gc:getStringWidth(title)
    local heightTitle = gc:getStringHeight(title)
    gc:setFont("sansserif", "r", FONT_SIZE)
    local widthDescription =  gc:getStringWidth(description)
    local heightDescription = gc:getStringHeight(description)
    gc:setFont("sansserif", "r", FONT_SIZE - 1)
    local widthTextHelp =  gc:getStringWidth(textHelp)
    local heightTextHelp = gc:getStringHeight(textHelp)
    
    -- Texto del buble de manera conjunta.
    local widthText = math.max(math.max(widthTitle, widthDescription), widthTextHelp)
    local heightText = heightTitle + PADDING_VERTICAL + heightDescription + PADDING_VERTICAL + heightTextHelp
    
    -- Valores geométricos finales. 
    local width = 4 * EDGE_BUBBLE + ICON_SIZE + BORDER + widthText
    local height = 2 * EDGE_BUBBLE + heightText
    local x = WIDTH / 2 - width / 2
    local y = HEIGHT / 2 - height / 2

    -- Dibujamos el fondo.
    gc:setColorRGB(COLOR_MIDLIGHT[1], COLOR_MIDLIGHT[2], COLOR_MIDLIGHT[3])
    gc:fillRect(x, y, width, height)
    gc:setColorRGB(COLOR_MID[1], COLOR_MID[2], COLOR_MID[3])
    gc:fillRect(x, y, 2 * EDGE_BUBBLE + ICON_SIZE, height)
    
    -- Dibujamos las líneas.
    gc:setColorRGB(0, 0, 0)
    gc:drawRect(x, y, width - 1, height - 1)
    gc:drawLine(x + 2 * EDGE_BUBBLE + ICON_SIZE, y + 1,
                x + 2 * EDGE_BUBBLE + ICON_SIZE, y + height - 2)
    
    -- Dibujamos el texto.
    gc:setColorRGB(COLOR_TEXT[1], COLOR_TEXT[2], COLOR_TEXT[3])
    gc:setFont("sansserif", "b", FONT_SIZE)
    gc:drawString(title, x + 3 * EDGE_BUBBLE + ICON_SIZE + BORDER, y + EDGE_BUBBLE + heightTitle)
    gc:setFont("sansserif", "r", FONT_SIZE)
    gc:drawString(description, x + 3 * EDGE_BUBBLE + ICON_SIZE + BORDER, y + EDGE_BUBBLE + heightTitle + PADDING_VERTICAL + heightDescription)
    gc:setFont("sansserif", "r", FONT_SIZE - 1)
    gc:drawString(textHelp, x + 3 * EDGE_BUBBLE + ICON_SIZE + BORDER, y + EDGE_BUBBLE + heightText)
    gc:setFont("sansserif", "r", FONT_SIZE)
    
    -- Dibujamos el icono.
