-- | Mecanismos para el manejo de errores |
-- +--------------------------------------+

function MasterBox:hasErrors()
    local result = false
    
    -- Buscamos componente que notifiquen un error.
    for k = 1, self.widgetsCount do
        if self.widgets[k].hasError == true then
            result = true
        end
    end
    
    return result
end

