function helpRound1(value, decimal)
	local mult = 10^(decimal or 0)
    return math.floor(value * mult + 0.5) / mult
end

function helpRound2(value, decimal)
	return tonumber(string.format("%." .. (decimal or 0) .. "f", value))
end

function helpToText(value)
	return "" .. value
end

function helpTextBox(gc, x, y, width, height, text, align)
    -- Creamos un CLIP para la tabla.
    gc:clipRect("set", x, y, width, height)

    -- Dibujamos el texto.
    if align == "LEFT" then
        gc:drawString(text, x, y + FONT_HEIGHT + PADDING_VERTICAL)
    elseif align == "CENTER" then
        local widthText = gc:getStringWidth(text)
        gc:drawString(text, x + width / 2 - widthText / 2, y + FONT_HEIGHT + PADDING_VERTICAL)
    elseif align == "RIGHT" then
        local widthText = gc:getStringWidth(text)
        gc:drawString(text, x + width - widthText, y + FONT_HEIGHT + PADDING_VERTICAL)
    end

    -- Deshacemos el CLIP de la caja de texto.
    gc:clipRect("reset")
end

function helpLaunch(func)
    collectgarbage("collect")
    print(collectgarbage("count"))
    func()
end

function helpWait(seconds)
    timer.start(seconds)
end